import { Container, Nav, Navbar} from "react-bootstrap";
import { Link } from "react-router-dom";
import './Header.css'
const Header = () => {
  return (
    <Navbar sticky='top' collapseOnSelect expand="lg" bg="light" variant="light" >
  <Container>
  {/* <Navbar.Brand ><Link to='/'><img className='logo' src="logo.jpg" alt="" /></Link></Navbar.Brand> */}
  <Navbar.Brand ><Link to='/'><h1>ELLA</h1></Link></Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav" className='justify-content-end'>
    <Nav>
      <Nav.Link as={Link} to='ourworks'>Client works</Nav.Link>
      <Nav.Link as={Link} to="/pricing">Pricing</Nav.Link>
      <Nav.Link as={Link} to='/order'>Order Now</Nav.Link>
      <Nav.Link as={Link} to='/about'>About</Nav.Link>
      <Nav.Link href="/">Contact us</Nav.Link>
      {/* <Nav.Link eventKey={2} href="#memes">
        Dank memes
      </Nav.Link> */}
    </Nav>
  </Navbar.Collapse>
  </Container>
</Navbar>
  );
}

export default Header
